Golden Earring - Long Blond Animal [TopPop 1980].VOB



Very HQ very rare uncensored tv show promo performance. AVRO's &quot;TopPop&quot; was the first weekly pop program broadcast on Dutch television. It ran from September 22, 1970 to June 27, 1988.

&quot;TopPop&quot; was mainly filled with pop artists in the top pop studio, playing to their latest hit. During the years of 1970-1974, 1978-1981 and 1986-1988, the artists were selected by the choice of the viewer. In the years 1974-1978 and 1981-1986, the National Charts were used instead.

&quot;Long Blond Animal&quot; is a song from Prisoner of the Night, an album by Dutch hard rock band Golden Earring, released in 1980.
